import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import './FooterNavigation.css';

function FooterNavigation() {
    const menus = [
        {
            navMenu: "Digital Clock",
            navLink: "digital-clock"
        },
        {
            navMenu: "India Covid19 Updates",
            navLink: "Covid"
        },
        {
            navMenu: "International Covid19 Updates",
            navLink: "international-covid-updates"
        },
    ]
    const [active, setActive] = useState(false);
    return (
        <footer className="footerNav">
            <nav className="navbar navbar-expand-lg navbar-light bg-light d-flex justify-content-center">
                <ul className="navbar-nav">
                    {
                        menus.map((e, i) => {
                            return <li className="nav-item" key={i}>
                                {/* <a 
                                    onClick={ () => setActive(!active)} 
                                    className={active ? "nav-link active" : "nav-link"} 
                                    aria-current="page" 
                                    href={`/${e.navLink}`}>
                                        {e.navMenu}
                                </a> */}
                                <Link className="nav-link" activeClassName={"active"} to={`/${e.navLink}`}> {e.navMenu} </Link>
                            </li>
                        })
                    }
                </ul>
            </nav>
        </footer>
    )
}

export default FooterNavigation;
